import React from "react";
import "../App.css";
import "bootstrap/dist/css/bootstrap.min.css";
import Filter from "../Components/Filters";
import { Container, Row, Col } from "react-bootstrap";
import avatar from "../assets/avatar.png";
import Cards from "../Components/Cards";

function Proposal() {
  return (
    <>
      <style type="text/css">
        {`

            .rowStyle {
                margin: 30px 0px 0px 30px;
            }

            .inputCol {
                width: 250px
            }

            .colFilter {
                margin: 30px 0px 25px;
            }

            @media screen and (max-width: 767px) {
                .rowStyle {
                    margin: 20px 16px 0px 16px;
                    padding-bottom: 18px;
                    align-items: center;
                }
                
            }

            @media screen and (max-width: 576px) {
              .inputCol {
                 width: 100%
             }

             .colFilter {
                margin: 25px 0px 16px;
            }

            }

          `}
      </style>

      <Container fluid className="proposal p-0">
        <Row className="rowStyle p-0">
          <Col xxl={8} lg={6} md={7} sm={6} className="p-0 ">
            <p className="pr"> Предложения </p>
          </Col>
          <Col lg={3} md={4}  className="p-0 inputCol">
            <input
              placeholder="Поиск"
              style={{ width: "100%" }}
              className="searchField"
            ></input>
          </Col>
          <Col  lg={1} style={{ paddingLeft: "16px" }}>
            <img className="avatar" src={avatar} alt={"avatar"}></img>
          </Col>
          <Row  className="p-0 ">
            <Col xs className="colFilter">
              <Filter />
            </Col>
          </Row>
        </Row>
        <Row xs={1} md={2} className="rowStyle">
          {/* <Col className="p-0 "> */}
          <Cards />
          {/* </Col> */}
        </Row>
      </Container>
    </>
  );
}

export default Proposal;
